public class CommonChild {

    //method to get index of a character-> need a list in case we have duplicate characters

    private static List<Integer> getIndexListOfCharacter(String s, char c) {
        List<Integer> characterIndexList = new ArrayList<>();
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == c) {
                characterIndexList.add(i);
            }
        }
        return characterIndexList;
    }




    public static int commonChild(String s1, String s2) {
        // Write your code here
        int result = 0;int lastIndex =0;
        for (int i = 0; i < s1.length(); i++) {
            if (s2.contains(String.valueOf(s1.charAt(i)))) {
                //we need the indices of s2, compared to s1
                List<Integer> indexList = getIndexListOfCharacter(s2, s1.charAt(i));
                for (int index : indexList) {
                    /*
                    ABCDEF
                    FBDAMN

                    output = 2
                    F meets first condition, but the index needs to not be lower than the last index to continue correctly the substring
                     */
                    if (index <= i && (index>lastIndex || lastIndex ==0)) {
                        lastIndex = index;
                        result += 1;
                        break;
                    }
                }
            }
        }
        return result;

    }

    public static void main(String[] args) {
        System.out.println(commonChild("ABCD","ABDC"));
        System.out.println(commonChild("HARRY", "SALLY"));
        System.out.println(commonChild("AA", "BB"));
        System.out.println(commonChild("SHINCHAN", "NOHARAAA"));
        System.out.println(commonChild("ABCDEF", "FBDAMN"));
        System.out.println(commonChild("WEWOUCUIDGCGTRMEZEPXZFEJWISRSBBSYXAYDFEJJDLEBVHHKS", "FDAGCXGKCTKWNECHMRXZWMLRYUCOCZHJRRJBOAJOQJZZVUYXIC"));
        System.out.println(commonChild("",
                ""));

    }
}
